import React, { Component } from 'react'
import '../App.css'
import { motion } from "framer-motion"

export class HomePage extends Component {

    render() {
        const variants = {
            visible: { opacity: 1 },
            hidden: { opacity: 0, 
                transition: {
                    ease: "easeIn",

                    staggerChildren: 2
                } 
            },
        }
        return (
            <div className="homeInfoCard">
                <motion.div variants={variants} initial="hidden" animate="visible" className="home-page-info">
                        <motion.h2 style={{fontSize: "6vh"}}>Andrew Zajac</motion.h2>
                        <motion.p style={{fontSize: "3vh"}}>Software Engineer</motion.p>
                </motion.div>


            </div>
        )
    }
}

export default HomePage
